# paranteze.py
def check_parentheses(sequence):
    stack = []
    for code in sequence:
        if code == 0 or code == 2:  # Open parentheses
            stack.append(code)
        elif code == 1 or code == 3:  # Close parentheses
            if not stack:
                return 'Nu'
            if (code == 1 and stack[-1] != 0) or (code == 3 and stack[-1] != 2):
                return 'Nu'
            stack.pop()
    return 'Da' if not stack else 'Nu'

def main():
    with open('paranteze.in', 'r') as fin:
        n = int(fin.readline().strip())
        results = []
        for _ in range(n):
            tokens = list(map(int, fin.readline().split()))
            L, sequence = tokens[0], tokens[1:]
            results.append(check_parentheses(sequence))

    with open('paranteze.out', 'w') as fout:
        for result in results:
            fout.write(result + '\n')

if __name__ == '__main__':
    main()
